An iterator where each iteration calls a generator function.

This struct is created by the [`from_fn`] function. See its documentation
for more details.

The generator returns `Maybe[T]`, where `Just(value)` yields the value
and `Nothing` ends the iterator. This provides full control over both
the yielded values and the termination condition.

# Example

```tml
use core::iter::*

var count: I32 = 0
var iter: FromFn[func() -> Maybe[I32]] = from_fn(do() -> Maybe[I32] {
    if count >= 3 {
        return Nothing
    }
    count = count + 1
    return Just(count)
})
// Yields 1, 2, 3, then Nothing
```

An iterator that repeats an element a fixed number of times.

This struct is created by the [`repeat_n`] function. See its documentation
for more details.

Unlike [`Repeat`], this iterator has a finite length and will terminate
after yielding the specified number of elements.

# Example

```tml
use core::iter::*

var iter: RepeatN[I32] = repeat_n(42, 3)
// iter.next() returns Just(42)
// iter.next() returns Just(42)
// iter.next() returns Just(42)
// iter.next() returns Nothing
```

An iterator of successive elements computed from an initial value.

This struct is created by the [`successors`] function. See its documentation
for more details.

Each element is computed by applying a successor function to the previous
element. The iterator continues until the successor function returns
`Nothing`.

# Example

```tml
use core::iter::*

// Geometric sequence: 1, 2, 4, 8, 16, ...
var iter = successors(Just(1), do(n: ref I32) -> Maybe[I32] {
    let next: I32 = *n * 2
    if next > 100 {
        return Nothing
    }
    return Just(next)
})
```

