Thread-safe reference-counted pointer.

This module provides [`Arc[T]`], an atomically reference-counted pointer
for sharing data safely between threads.

# Overview

`Arc` stands for "Atomically Reference Counted". It allows multiple owners
of the same data by keeping track of how many owners exist. When the last
owner is dropped, the data is deallocated.

Unlike `Rc[T]` (which would be single-threaded), `Arc[T]` uses atomic
operations for its reference counting, making it safe to share across
threads.

# When to Use Arc

Use `Arc` when you need to share immutable data between threads. For
mutable data, combine with `Mutex` or `RwLock`:

```tml
use std::sync::{Arc, Mutex}

let shared = Arc::new(Mutex::new(0))

// Clone Arc to share with another thread
let shared2 = shared.clone()

// Each thread can lock and modify the data
{
    let mut guard = shared.lock()
    *guard = *guard + 1
}
```

# Examples

## Basic Usage

```tml
use std::sync::Arc

let five = Arc::new(5)

// Clone increases the reference count
let also_five = five.clone()

assert_eq(*five, 5)
assert_eq(*also_five, 5)
```

## Sharing Between Threads

```tml
use std::sync::Arc
use std::thread

let numbers = Arc::new([1, 2, 3, 4, 5])

let mut handles = []
loop i in 0 to 5 {
    let numbers_clone = numbers.clone()
    handles.push(thread::spawn(do() {
        println("Thread sees: " + (*numbers_clone)[i].to_string())
    }))
}

for h in handles {
    h.join()
}
```

Atomic types for lock-free concurrent programming.

This module provides atomic types that can be safely shared between threads.
All operations on atomic types are guaranteed to be indivisible, meaning
that no thread can observe a partial state.

# Overview

Atomic types are the foundation of lock-free concurrent programming.
They provide:

- **Atomicity**: Operations complete fully or not at all
- **Memory ordering**: Control over how operations are observed across threads
- **Lock-free guarantees**: Progress is guaranteed without locks

# Available Types

| Type | Description |
|------|-------------|
| [`AtomicBool`] | Atomic boolean |
| [`AtomicI32`] | 32-bit signed atomic integer |
| [`AtomicI64`] | 64-bit signed atomic integer |
| [`AtomicU32`] | 32-bit unsigned atomic integer |
| [`AtomicU64`] | 64-bit unsigned atomic integer |
| [`AtomicIsize`] | Pointer-sized signed atomic integer |
| [`AtomicUsize`] | Pointer-sized unsigned atomic integer |
| [`AtomicPtr[T]`] | Atomic raw pointer |

# Memory Ordering

All atomic operations take an [`Ordering`] parameter that specifies
the memory ordering constraints. See the [`ordering`][super::ordering]
module for details.

# Examples

## Simple Counter

```tml
use sync::atomic::{AtomicU64, Ordering}

let counter = AtomicU64::new(0)

// Thread-safe increment
counter.fetch_add(1, Ordering::Relaxed)

// Read current value
let value = counter.load(Ordering::Relaxed)
```

## Spin Lock

```tml
use sync::atomic::{AtomicBool, Ordering, spin_loop_hint}

type SpinLock {
    locked: AtomicBool
}

impl SpinLock {
    func new() -> SpinLock {
        SpinLock { locked: AtomicBool::new(false) }
    }

    func lock(mut self) {
        loop (true) {
            when self.locked.compare_exchange(
                false, true,
                Ordering::Acquire, Ordering::Relaxed
            ) {
                Ok(_) => break,
                Err(_) => spin_loop_hint()
            }
        }
    }

    func unlock(mut self) {
        self.locked.store(false, Ordering::Release)
    }
}
```

## Compare-and-Swap Loop

```tml
use sync::atomic::{AtomicI32, Ordering}

func fetch_update(a: mut ref AtomicI32, f: do(I32) -> I32) -> I32 {
    let mut current = a.load(Ordering::Relaxed)
    loop (true) {
        let new = f(current)
        when a.compare_exchange_weak(
            current, new,
            Ordering::SeqCst, Ordering::Relaxed
        ) {
            Ok(x) => return x,
            Err(x) => current = x
        }
    }
}
```

