let handle = thread::spawn(do() {
    let (lock, cvar) = ref *pair2
    let mut started = lock.lock()

    // Wait until the producer signals
    loop not *started {
        started = cvar.wait(started)
    }

    println("Consumer: received signal!")
})

// Producer thread
{
    let (lock, cvar) = ref *pair
    let mut started = lock.lock()
    *started = true
    cvar.notify_one()
}

handle.join().unwrap()
```

