use sync::{Mutex, Condvar}

let mutex = Mutex::new(0)
let cvar = Condvar::new()

// Wait until value >= 10
let guard = mutex.lock()
let guard = cvar.wait_while(guard, do(val: ref I32) -> Bool {
    return *val < 10
})

assert(*guard >= 10)
```

