Memory ordering semantics for atomic operations.

This module defines the [`Ordering`] enum which specifies the memory
ordering constraints for atomic operations. These orderings mirror
the C++11/LLVM memory model.

# Memory Ordering Basics

Memory orderings control how operations on different memory locations
can be reordered relative to atomic operations. Weaker orderings allow
more reordering (better performance) but provide fewer guarantees.

# Ordering Levels

From weakest to strongest:

- [`Relaxed`][Ordering::Relaxed]: No synchronization, only atomicity
- [`Acquire`][Ordering::Acquire]: Prevents reordering of reads/writes before this load
- [`Release`][Ordering::Release]: Prevents reordering of reads/writes after this store
- [`AcqRel`][Ordering::AcqRel]: Both acquire and release semantics
- [`SeqCst`][Ordering::SeqCst]: Full sequential consistency

# Examples

## Simple Counter (Relaxed)

```tml
use sync::atomic::{AtomicU64, Ordering}

let counter = AtomicU64::new(0)

// Multiple threads incrementing - order doesn't matter
counter.fetch_add(1, Ordering::Relaxed)
```

## Flag Signaling (Acquire/Release)

```tml
use sync::atomic::{AtomicBool, Ordering}

let data_ready = AtomicBool::new(false)
let data: I64 = 0

// Producer thread:
data = 42  // Write data
data_ready.store(true, Ordering::Release)  // Signal data is ready

// Consumer thread:
loop (true) {
    if data_ready.load(Ordering::Acquire) {
        // Can safely read `data` here - acquire synchronizes with release
        println(data)
        break
    }
}
```

Lock-free concurrent queue.

This module provides [`LockFreeQueue[T]`], a thread-safe queue that uses
atomic operations instead of locks for synchronization.

# Overview

The queue is based on the Michael-Scott lock-free queue algorithm,
which provides wait-free `push` and lock-free `pop` operations.

# When to Use

Use `LockFreeQueue` when:
- You need a thread-safe FIFO queue
- Lock contention is high
- You want to avoid blocking threads

For lower contention scenarios, `Mutex[Queue]` may be simpler and equally fast.

# Examples

## Basic Usage

```tml
use std::sync::LockFreeQueue

let queue = LockFreeQueue[I32]::new()

queue.push(1)
queue.push(2)
queue.push(3)

assert_eq(queue.pop(), Just(1))
assert_eq(queue.pop(), Just(2))
assert_eq(queue.pop(), Just(3))
assert_eq(queue.pop(), Nothing)
```

## Multi-threaded Producer-Consumer

```tml
use std::sync::{Arc, LockFreeQueue}
use std::thread

let queue = Arc::new(LockFreeQueue[I32]::new())

// Producer thread
let q1 = queue.clone()
let producer = thread::spawn(do() {
    loop i in 0 to 100 {
        q1.push(i)
    }
})

// Consumer thread
let q2 = queue.clone()
let consumer = thread::spawn(do() {
    var count: I32 = 0
    loop (count < 100) {
        when q2.pop() {
            Just(_) => count = count + 1,
            Nothing => thread::yield_now()
        }
    }
})

producer.join()
consumer.join()
```

Reader-writer lock for concurrent read access.

This module provides [`RwLock[T]`], a reader-writer lock that allows
multiple readers or a single writer at any time.

# Overview

A reader-writer lock allows:
- Multiple readers simultaneously (shared access)
- One writer at a time (exclusive access)
- No readers while a writer holds the lock

This is useful when data is read frequently but written rarely.

# RwLock vs Mutex

- Use [`RwLock`] when reads are much more common than writes
- Use [`Mutex`][super::mutex::Mutex] when access patterns are mixed
- `RwLock` has slightly higher overhead than `Mutex`

# Examples

## Basic Usage

```tml
use sync::rwlock::RwLock

let lock = RwLock::new(5)

// Multiple readers can access simultaneously
{
    let r1 = lock.read()
    let r2 = lock.read()
    assert_eq(*r1, 5)
    assert_eq(*r2, 5)
}  // read locks released

// Only one writer at a time
{
    let mut w = lock.write()
    *w = 6
}  // write lock released
```

Thread-local storage.

This module provides [`LocalKey[T]`], a key for accessing thread-local data.
Each thread has its own copy of thread-local data.

# Overview

Thread-local storage (TLS) allows each thread to have its own isolated copy
of data. This is useful for per-thread caches, random number generators,
or any data that should not be shared between threads.

# Examples

## Basic Usage with @thread_local

```tml
use std::thread::{LocalKey, local_access}

// Declare thread-local storage
@thread_local
let COUNTER: LocalKey[I32] = LocalKey::new(do() 0)

// Access the thread-local value
COUNTER.access(do(value: ref I32) {
    print("Counter: {*value}\n")
})

// Modify the thread-local value
COUNTER.access_mut(do(value: mut ref I32) {
    *value = *value + 1
})
```

## Per-Thread Data

```tml
use std::thread::{LocalKey, spawn}

@thread_local
let THREAD_ID: LocalKey[U64] = LocalKey::new(do() 0)

let handles = []
loop i in 0 to 4 {
    handles.push(spawn(do() {
        THREAD_ID.access_mut(do(id: mut ref U64) {
            *id = current().id().as_u64()
        })
        THREAD_ID.access(do(id: ref U64) {
            print("Thread {*id} running\n")
        })
    }))
}

for h in handles {
    h.join()
}
```

# Initialization

Thread-local values are lazily initialized on first access in each thread.
The initializer function is called once per thread that accesses the value.

Native threads for parallel execution.

This module provides support for spawning native OS threads, including:

- **Thread spawning**: Create new threads with [`spawn`]
- **Thread joining**: Wait for threads to complete with [`JoinHandle::join`]
- **Thread control**: Sleep, yield, park/unpark threads
- **Thread information**: Get current thread, thread IDs, names

# The Threading Model

TML uses native OS threads (1:1 threading model). Each TML thread maps
directly to an OS thread, providing:

- True parallelism on multi-core systems
- Familiar OS-level semantics
- Compatibility with C libraries and system calls

# Thread Safety

To spawn a thread, the closure and its captured values must be `Send`:

- Owned values are moved into the thread
- Shared references must point to `Sync` data
- Use [`Sync[T]`][sync::Sync] for shared ownership across threads

# Examples

## Basic Thread Spawn

```tml
use thread

let handle = thread::spawn(do() {
    println("Hello from a thread!")
    return 42
})

let result = handle.join().unwrap()
assert_eq(result, 42)
```

## Named Threads

```tml
