let handle = Builder::new()
    .name("worker-1")
    .spawn(do() {
        let current = thread::current()
        println("Running in thread: " + current.name().unwrap_or("unnamed"))
    })
    .unwrap()

handle.join().unwrap()
```

## Sleeping and Yielding

```tml
